import React, { useState, useEffect } from 'react';
import { motion, useScroll, useTransform } from 'framer-motion';
import './Header.css';

const Header = ({ currentPage, onNavigate, darkMode, toggleDarkMode }) => {
  const [isScrolled, setIsScrolled] = useState(false);
  const { scrollY } = useScroll();
  
  // Transform header background opacity based on scroll
  const headerOpacity = useTransform(scrollY, [0, 100], [0.95, 1]);
  const headerBlur = useTransform(scrollY, [0, 100], [10, 20]);

  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 20);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const navItems = [
    { id: 'home', label: 'Home', icon: '🏠' },
    { id: 'identification', label: 'Identify', icon: '🔍' },
    { id: 'local-rules', label: 'Local Rules', icon: '📋' },
    { id: 'upcycling', label: 'Upcycling', icon: '♻️' },
  ];

  return (
    <motion.header 
      className={`header ${isScrolled ? 'scrolled' : ''}`}
      style={{ opacity: headerOpacity }}
    >
      <div className="container">
        <div className="header-content">
          {/* Logo with advanced animation */}
          <motion.div
            className="logo"
            onClick={() => onNavigate('home')}
            initial={{ opacity: 0, x: -20 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.5 }}
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <motion.span 
              className="logo-icon"
              animate={{ rotate: [0, 360] }}
              transition={{ duration: 10, repeat: Infinity, ease: "linear" }}
              whileHover={{ scale: 1.2, rotate: 0 }}
            >
              🌱
            </motion.span>
            <motion.h1
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ delay: 0.2 }}
            >
              Smart Ecodispose
            </motion.h1>
          </motion.div>

          {/* Navigation */}
          <motion.div
            className="nav-wrapper"
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 0.5, delay: 0.2 }}
          >
            <nav className="nav">
              {navItems.map((item, index) => (
                <motion.button
                  key={item.id}
                  className={`nav-btn ${currentPage === item.id ? 'active' : ''}`}
                  onClick={() => onNavigate(item.id)}
                  initial={{ opacity: 0, y: -20 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.3, delay: index * 0.1 }}
                  whileHover={{ 
                    scale: 1.05,
                    y: -3,
                    boxShadow: '0 8px 20px rgba(0, 0, 0, 0.2)'
                  }}
                  whileTap={{ scale: 0.95 }}
                >
                  <motion.span 
                    className="nav-icon"
                    whileHover={{ 
                      scale: 1.3,
                      rotate: 10,
                      transition: { duration: 0.2 }
                    }}
                  >
                    {item.icon}
                  </motion.span>
                  <span className="nav-label">{item.label}</span>
                  {currentPage === item.id && (
                    <motion.div
                      className="active-indicator"
                      layoutId="activeIndicator"
                      initial={{ opacity: 0 }}
                      animate={{ opacity: 1 }}
                      transition={{ duration: 0.3 }}
                    />
                  )}
                </motion.button>
              ))}
            </nav>

            {/* Theme Toggle with enhanced animation */}
            <motion.button
              className="theme-toggle"
              onClick={toggleDarkMode}
              whileHover={{ 
                scale: 1.15,
                rotate: 180,
                boxShadow: '0 8px 20px rgba(0, 0, 0, 0.2)'
              }}
              whileTap={{ scale: 0.9 }}
              transition={{ duration: 0.3 }}
              initial={{ opacity: 0, rotate: -180 }}
              animate={{ opacity: 1, rotate: 0 }}
            >
              <motion.span
                key={darkMode ? 'moon' : 'sun'}
                initial={{ rotate: 90, opacity: 0 }}
                animate={{ rotate: 0, opacity: 1 }}
                exit={{ rotate: -90, opacity: 0 }}
                transition={{ duration: 0.3 }}
              >
                {darkMode ? '🌙' : '☀️'}
              </motion.span>
            </motion.button>
          </motion.div>
        </div>
      </div>

      {/* Animated underline on scroll */}
      <motion.div
        className="header-underline"
        initial={{ scaleX: 0 }}
        animate={{ scaleX: isScrolled ? 1 : 0 }}
        transition={{ duration: 0.3 }}
      />
    </motion.header>
  );
};

export default Header;
